import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Page from "./menuAwal/Page";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/m" element={<Page />} />
          
        </Routes>
      </Router>
    </div>
  );
}

export default App;
